import React from "react";
import classNames from 'classnames/bind';
import hamburgerMenu from  "../HamburgerMenu/hamburgerMenu.scss";

let hamburgerMenuStyle = classNames.bind(hamburgerMenu);


const HamburgerMenu =({  handleHamburgerMenu,hamburgerIsOpen}) => {
  let className = hamburgerMenuStyle({
    base:true,
    'menu active': hamburgerIsOpen,
    'menu_item_meatballs ': !hamburgerIsOpen
})
  return (
    <button onClick={handleHamburgerMenu} className="HamburgerMenu">
      <div className="menu_wrapper">
        <div className="menu_item_meatballs">
          <div className="circle"></div>
          <div className="circle"></div>
          <div className="circle"></div>
        </div>
      </div>
    </button>
  );
}


export default HamburgerMenu;
